'use strict';
var h;
var w;


var past;
var now;
var col;
var newgesture = true;
var endgesture = true;
var touched = false;
var totalLength = 0;
var autodrawinit = false;
var autodrawing = false;
var recordDraw = true;

var record = [];


var setup = function(){
  colorMode(HSB, 360,1,1)
  createCanvas(windowWidth, windowHeight);
  angleMode(DEGREES);

  col = color(0,0,1);
  w = windowWidth;
  h = windowHeight;

  //disable default touch events for mobile
  var el = document.getElementsByTagName("canvas")[0];
  el.addEventListener("touchstart", pdefault, false);
  el.addEventListener("touchend", pdefault, false);
  el.addEventListener("touchcancel", pdefault, false);
  el.addEventListener("touchleave", pdefault, false);
  el.addEventListener("touchmove", pdefault, false);

  past = createVector(0, 0);
  background(color(0,0,0));
  initCover();
}

function windowResized() {
  resizeCanvas(windowWidth, windowHeight);
}

function pdefault(e){
  e.preventDefault()
}

var touchStarted= function(){
    newgesture = true;
    if(!touched){
      var el = document.getElementById("info");
      if(el){
        el.remove();
      }
    }
    touched = true;

    return false;
}

var touchMoved= function(){
  pressed(touchX,touchY);
  return false;
}

var touchEnded= function(){
  pressed(touchX,touchY);
  endgesture = true;

  if(totalLength==0){

    initCover();
  }
  return false;
}

var initCover = function(){
  background(1,0,1);
  push();

  rotate(45);
  var recw = 40;
  var numr = w/recw;
  for(var i =0; i<numr+200;i++){
      var c =320*i/numr;
      var l = 1;
     noStroke();
     fill(c,0,1);
   //  rect(recw*i,-2*h,recw,h)
     noStroke();
     fill(c,0,0);
     rect(recw*i,-4*h,recw/2,6*h)
  }

  pop();
}

var pressed= function(x,y){
  //record.push([(x/w).toFixed(4),(y/h).toFixed(4)]);
  now = createVector(x,y);
  if(newgesture){
    past = now;
    past.p1 = createVector(0,0);
    past.p2 = createVector(0,0);
    past.n1= createVector(0,0);
    past.n2= createVector(0,0);
    past.r = 0;
    past.hue = 0;
    newgesture = false;

  }
  drawCircle(now);
}


var drawCircle = function(){


    var diffv = p5.Vector.sub(now,past).mult(0.4);
    var dist = diffv.mag();

    //now= p5.Vector.add(diffv,past);
    totalLength+=dist;


    var inputproc = min(pow(dist,1/2),14);

    //if(abs(diffv.x*4)<abs(diffv.y)){


    var r = inputproc*(10);
    //ellipse(now.x,now.y,r,r);



    if(dist==0){
      r = past.r;
    }
    now.r = r;

    /*
    line(now.x,now.y,past.x, past.y)
    noFill();
    stroke(col);
    strokeWeight(2);
    */

    //perpendicular
    var n1 = createVector(-1*diffv.y, diffv.x);
    var n2 = createVector(diffv.y, -1*diffv.x);

    if(n1.mag()==0){
      n1 = past.n1;
      n2 = past.n2;
    }

    var p1 = p5.Vector.add(now,n1.normalize().mult(r/2));
    var p2 = p5.Vector.add(now,n2.normalize().mult(r/2));
    now.p1 = p1;
    now.p2 = p2;
    now.n1 = n1;
    now.n2 = n2;

    /*
    line(p1.x,p1.y,p2.x, p2.y)
    noFill();
    stroke(col);
    */

    //shape
    if(dist>0){
    var ang = 180+diffv.heading();
    ang+=90;
    ang%=360;
    now.hue = ang;

    //fade
    var huediff = abs(past.hue - now.hue);
    if(huediff> (360-huediff)){
      if(past.hue < now.hue){
        past.hue +=360;
      }else{
        now.hue +=360;
      }


    }
    fcol = lerp(past.hue, now.hue, 0.5);
    fcol%=360;
    now.hue %=360;
    past.hue%=360;
    col = color(fcol,1,1);


    stroke(col);
    fill(col);


    beginShape();
    vertex(past.p1.x,past.p1.y);
    vertex(past.p2.x,past.p2.y);

    vertex(now.p2.x,now.p2.y);
    vertex(now.p1.x,now.p1.y);
    endShape(CLOSE);

    //circles
    var numCirc = 1;
    if(r>4){
        numCirc = diffv.mag()/(r/4);
    }
    numCirc=floor(r);

    for(var i=0; i<numCirc; i++){

      var fcol = lerp(past.hue, now.hue, i/numCirc);

      var huediff = abs(past.hue - now.hue);

      //case to wrap around
      if(huediff> (360-huediff)){
          if(past.hue < now.hue){
            past.hue +=360;
          }else{
          now.hue +=360;
          }

        fcol = lerp(past.hue, now.hue, i/numCirc);
        fcol%=360;
        now.hue %=360;
        past.hue%=360;
      }



      stroke(fcol,1,1);
      fill(fcol,1,1);
      var cx =lerp(past.x, now.x, i/numCirc);
      var cy =lerp(past.y, now.y, i/numCirc);
      var cr =lerp(past.r, r, i/numCirc);
      ellipse(cx,cy,cr,cr);
    }


    //shift in time
    past = now;
    }
}

var autox;
var autoy;
var autoang;
var autospeed;
var angspeed;
var angtime;

var initAuto = function(){
      autoang = random(360);
      autospeed = random(5,15);
      angspeed = random(-10,10);
}

var draw = function(){
  if(touchIsDown || mouseIsPressed){
    if(endgesture){
      newgesture = true;
      endgesture = false;
      totalLength = 0;
    }
  }

  if(!touched){
    if(autodrawinit){
      initCover();
      newgesture = true;
      autodrawinit= false;
      autodrawing=true;
      autox = w/2;
      autoy = h/2;
      initAuto();
    }


    if(autodrawing){
    autox+=autospeed*cos(autoang);
    autoy+=autospeed*sin(autoang);
    autoang+=angspeed;

    if(frameCount%100==0){
      initAuto();
    }

    if(autoy>h || autoy<0 || autox > w || autox <0){
      autoang+=180;
      autoang%=360;
    }

    pressed(autox, autoy);

    }

    if(recordDraw){
      if(record.length > 0){
      var cords = record.shift();
      pressed(cords[0]*w,cords[1]*h);
      }
      else{
      var el = document.getElementById("info");
      el.remove();
      recordDraw = false;
      autodrawinit = true;
      }
    }

  }
}

Element.prototype.remove = function() {
    this.parentElement.removeChild(this);
}
NodeList.prototype.remove = HTMLCollection.prototype.remove = function() {
    for(var i = this.length - 1; i >= 0; i--) {
        if(this[i] && this[i].parentElement) {
            this[i].parentElement.removeChild(this[i]);
        }
    }
}

